import React from "react";

const Footer = () => {
  return (
    <section id="footer">
      <div className="footerGrid">
        <div className="brand">
          B<span className="stretch">O</span>
          <span className="stretch">O</span>M<br />
          <span className="brandcoffee">COFFEE</span>
        </div>
        <div className="linksColumn "></div>
        <div className="linksColumn"></div>
        <div className="linksColumn"></div>
        <div className="linksColumn"></div>
      </div>
      <div className="footerTail">
        <p id="copyright">Copyright @ 2020 BOOM COFFEE. All rights reserved.</p>
        <p id="policy">
          <a>PRIVACY POLICY</a>
          <a>TERMS OF USE</a>
        </p>
      </div>
    </section>
  );
};

export default Footer;
